import React from 'react'
import "./Card.scss";

export default function Card() {
    return (
        <div className='card'>
            <img src="https://ih1.redbubble.net/image.385613112.4548/fposter,small,wall_texture,product,750x1000.u4.jpg"
                alt="" />
            <div className="cardInfo">
                <span>1hour 14 mins</span>
            </div>
        </div>
    )
}
